import React, { FC } from "react";
import HighOrderComp from "../HOC/HighOrderComp";
import mockImage from "../../assets/images/mockImage.jpg";
import { Link } from "react-router-dom";
import "../../styles/newsBody.scss";

interface AllNewsProps {
  data: ArticleProps[];
}

interface ArticleProps {
  title: string;
  url: string;
  urlToImage: string | undefined;
  description: string;
  publishedAt: string;
}

interface setDataProps extends AllNewsProps {
  setData: () => void;
}
const items: any[] = [
  {
    id: "1",
    name: "Kokos",
    publishedAt: "2023-05-09T15:15:16Z",
  },
  {
    id: "2",
    name: "Zmaj",
    publishedAt: "2021-05-09T15:15:16Z",
  },
  {
    id: "3",
    name: "Roko",
    publishedAt: "2022-05-09T15:15:16Z",
  },
];
console.log("items", items);

const AllNews: FC<setDataProps> = React.memo(
  ({ setData, data }: setDataProps) => {
    const parseTime = (time: string) => {
      const parsedDate = new Date(time).toLocaleDateString();
