          <div className="sort-btn">
            <button>Asc</button>
            <button>Desc</button>
          </div>
          {data.slice(1, 2).map((item: ArticleProps) => {
            return (
              <div key={item.publishedAt} className="header-section">
                <div className="header-left">
                  <h3 className="title">{item.title}</h3>
                  <div>
                    <Link className="category-btn" to={item.url}>
                      Kategorija
                    </Link>
                    <Link className="category-btn" to={item.url}>
                      Vrijeme ƒçitanja 5 min
                    </Link>
                    <p className="time">
                      Published: {parseTime(item.publishedAt)}
                    </p>
                  </div>
                </div>
                <div className="header-right">
                  {item.urlToImage !== undefined || item.urlToImage !== null ? (
                    <img
                      width={650}
                      height={400}
                      loading="lazy"
                      src={item.urlToImage}
                      alt={item.description}
                    />
                  ) : (
                    <img
                      width={650}
                      height={400}
                      loading="lazy"
                      src={mockImage}
                      alt={item.description}
                    />
                  )}
                </div>
              </div>
            );
          })}
          <hr />
        </div>
        <div className="middle-section">
          {data.slice(2, 5).map((item: ArticleProps) => {
            return (
              <div className="card" key={item.publishedAt}>
                {item.urlToImage === undefined || item.urlToImage === null ? (
                  <img
                    width={360}
                    height={222}
                    loading="lazy"
                    src={mockImage}
                    alt={item.description}
                  />
                ) : (
                  <img
                    width={360}
                    height={222}
                    loading="lazy"
                    src={item.urlToImage}
                    alt={item.description}
                  />
                )}
                <p className="time">Published: {parseTime(item.publishedAt)}</p>
                <h3 className="title">{item.title}</h3>
                <Link className="category-btn" to={item.url}>
                  Enter
                </Link>
              </div>
            );
          })}
        </div>
        <hr />
        <div className="bottom-section">
          <div className="column">
            {data.slice(5, 10).map((item: ArticleProps) => {
              return (
                <div className="card-bottom" key={item.publishedAt}>
                  <div>
                    {item.urlToImage === undefined ||
                    item.urlToImage === null ? (
                      <img
                        width={200}
                        height={122}
                        loading="lazy"
                        src={mockImage}
                        alt={item.description}
                      />
                    ) : (
                      <img
                        width={200}
                        height={122}
                        loading="lazy"
                        src={item.urlToImage}
                        alt={item.description}
                      />
                    )}
                  </div>
                  <div className="right-side">
                    <p className="time">
                      Published: {parseTime(item.publishedAt)}
                    </p>
                    <h3 className="title">{item.title}</h3>
                    <Link className="category-btn" to={item.url}>
                      Enter
                    </Link>
                  </div>
                </div>
              );
            })}
          </div>
          <div>
            <p>Left side</p>
          </div>
        </div>
        <hr className="rule" />
        {/* 2 div */}
      </>
    );
  }
);

const url: string = `http://localhost:5000/api/everything`;

const AllNewsComponent: any = HighOrderComp(AllNews, url);

export default AllNewsComponent;
